import React, { useEffect, useState, useRef } from 'react';
import './FireDashboard.css';

const TableauDashboard = ({ 
  title = 'California Wildfire Dashboard',
  description = 'Interactive visualization of California wildfire data using Tableau, providing in-depth analysis and insights.',
  vizUrl = 'https://public.tableau.com/views/DataConsolidation_FinalDraft_2/WildFireDashboardOverview',
  height = '827px'
}) => {
  const vizContainerRef = useRef(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [viz, setViz] = useState(null);

  useEffect(() => {
    let scriptElement = null;
    let mounted = true;

    const loadTableauAPI = () => {
      // Check if script is already loaded
      if (window.tableau && window.tableau.Viz) {
        initializeTableauViz();
        return;
      }

      // Create and load the Tableau API script
      scriptElement = document.createElement('script');
      scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';
      scriptElement.async = true;

      scriptElement.onload = () => {
        if (mounted) {
          console.log('Tableau API loaded successfully');
          // Wait a bit to ensure everything is initialized
          setTimeout(initializeTableauViz, 100);
        }
      };

      scriptElement.onerror = (err) => {
        if (mounted) {
          console.error('Failed to load Tableau API:', err);
          setError('Failed to load Tableau visualization API. Please check your internet connection and try again.');
          setLoading(false);
        }
      };

      document.body.appendChild(scriptElement);
    };

    const initializeTableauViz = () => {
      if (!vizContainerRef.current || !window.tableau || !window.tableau.Viz) {
        console.error('Tableau API not available or container not found');
        setError('Could not initialize Tableau visualization. The required libraries may not be available.');
        setLoading(false);
        return;
      }

      try {
        // Clean up any previous viz
        if (viz) {
          viz.dispose();
        }

        // Clear the container
        while (vizContainerRef.current.firstChild) {
          vizContainerRef.current.removeChild(vizContainerRef.current.firstChild);
        }

        // Create options object
        const options = {
          hideTabs: false,
          hideToolbar: false,
          width: '100%',
          height: height,
          onFirstInteractive: () => {
            console.log('Tableau visualization is interactive and ready');
            if (mounted) {
              setLoading(false);
            }
          }
        };

        // Create new visualization using the correct API
        const newViz = new window.tableau.Viz(vizContainerRef.current, vizUrl, options);

        if (mounted) {
          setViz(newViz);
        }
      } catch (err) {
        console.error('Error initializing Tableau visualization:', err);
        if (mounted) {
          setError(`Failed to create Tableau visualization: ${err.message}`);
          setLoading(false);
        }
      }
    };

    // Start the loading process
    loadTableauAPI();

    // Cleanup function
    return () => {
      mounted = false;
      if (viz) {
        try {
          viz.dispose();
        } catch (e) {
          console.warn('Error disposing Tableau viz:', e);
        }
      }

      if (scriptElement && document.body.contains(scriptElement)) {
        document.body.removeChild(scriptElement);
      }
    };
  }, [vizUrl, height]);

  return (
    <div className="chart-container">
      <h3 className="section-title">
        <svg xmlns="http://www.w3.org/2000/svg" className="section-icon" viewBox="0 0 20 20" fill="currentColor">
          <path fillRule="evenodd" d="M2 5a2 2 0 012-2h12a2 2 0 012 2v10a2 2 0 01-2 2H4a2 2 0 01-2-2V5zm3.293 1.293a1 1 0 011.414 0l3 3a1 1 0 010 1.414l-3 3a1 1 0 01-1.414-1.414L7.586 10 5.293 7.707a1 1 0 010-1.414z" clipRule="evenodd" />
        </svg>
        {title}
      </h3>
      <div className="chart-description">
        {description}
      </div>

      <div className="tableau-container" style={{ minHeight: height }}>
        {loading && (
          <div className="loading-container">
            <div className="loading-spinner">
              <div className="spinner"></div>
              <div className="loading-text">Loading visualization...</div>
            </div>
          </div>
        )}

        {error && (
          <div className="error-message">
            <div className="flex">
              <div className="flex-shrink-0">
                <svg className="error-icon" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
                  <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                </svg>
              </div>
              <div className="ml-3">
                <h3 className="error-title">Visualization Error</h3>
                <div className="error-details">
                  <p>{error}</p>
                </div>
                <button 
                  className="refresh-button" 
                  style={{ marginTop: '10px' }}
                  onClick={() => window.location.reload()}
                >
                  Try Again
                </button>
              </div>
            </div>
          </div>
        )}

        <div 
          ref={vizContainerRef} 
          className="tableau-viz-container"
          style={{ 
            width: '100%', 
            height: height,
            display: loading ? 'none' : 'block' 
          }}
        ></div>
      </div>

      <div className="data-source-note" style={{ marginTop: '10px', fontSize: '0.8rem', color: '#6b7280' }}>
        Note: This visualization requires an internet connection to load the Tableau Public dashboard.
      </div>
    </div>
  );
};

export default TableauDashboard;
